import React from 'react';

class ReviewHome extends React.PureComponent {

    render() {
        return (
            <div className="review-home">
                <div className="container">
                    <div className="row">
                        <div className="col-12 text-center">
                            <h2>รีวิวนี้ เป็นเพียงบางส่วนเท่านั้นจ้า</h2>
                            <h2>มาเรียนด้วยกัน พี่ๆพร้อมจะสร้างความฝันให้น้องๆ </h2>
                            <h1><strong>ฝันให้ไกล ..</strong>แล้ว <strong>ไปให้ถึง</strong></h1>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default ReviewHome;
